import { useParams } from "react-router-dom";

interface Ingredient {
  name: string;
  quantity: number;
  unit: string;
}

interface Recipe {
  img: string;
  _id: string;
  title: string;
  ingredients: Ingredient[];
}



function HomeRecipes() {
  return (
    <div className="recipes">
      {recipes &&
        recipes.map((recipe) => (
          <div key={recipe._id}>
            <img src={recipe.img} alt="food-img"></img>
            <p>{recipe.title}</p>
            <button
              className="save-recipe-btn"
              onClick={() => saveUserRecipes(recipe._id)}
            >
              Save
            </button>
          </div>
        ))}
    </div>
  );
}

export default HomeRecipes;
